// src/components/Programs.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Programs = () => {
  return (
    <div>
      <h2>Our Programs</h2>

          <h3>Science Club</h3>
          <p>A club where students explore various scientific concepts through experiments, projects, and field trips. Students get hands-on experience and participate in science fairs and competitions.</p>
          <h3>Math Olympiad</h3> 
          <p>A program designed to develop problem-solving and critical thinking skills through challenging math problems and contests. Students prepare for regional and national math competitions.</p>
          <h3>Art and Craft Workshop</h3>
          <p>An interactive workshop to encourage creativity and artistic skills. Students learn different art techniques including painting, sketching, and craft making.</p>


        </div>
  );
};

export default Programs;
